import React from 'react';
import "./Appoint.css";

const Appoint = () => (
    <div className="Appoint">
        <div className="lander">
            <h1>Appointment Page</h1>
            <br/>
            <p>This is the appointment page!</p>
        </div>
    </div>
);

export default Appoint;
